def extract_max_feature_from_MODTRAN(json: dict) -> np.array:
    """This function returns an array of points corresposnding to the specific feature."""
    key = list(json.keys())[0]
    ind = 0
    for i in range(len(json[key]['roots']['references'])):
        if 'data' in json[key]['roots']['references'][i]['attributes']:
            ind = i

    xpoint = np.array(
        json[key]['roots']['references'][ind]['attributes']['data']['x'])
    ypoints = np.array(
        json[key]['roots']['references'][ind]['attributes']['data']['y'])
    xpoints = np.array([d * 1000 for d in xpoint])

    def distance(xl, yl, i, k):
        l = []
        for j in range(1, k + 1):
            l.append(abs(yl[i + j] - yl[i]))
            l.append(abs(yl[i - j] - yl[i]))
        return sum(l)

    def max_d(xl, yl, j=2):
        dis = []
        for i in range(j, len(yl) - j):
            dis.append(distance(xl, yl, i, j))
        print(dis)
        return dis.index(max(dis)) + j

    feature_wavelength = xpoints[max_d(xpoints, ypoints, j=6)]

    n1, n2 = feature_wavelength - 50, feature_wavelength + 50
    xp = np.array([d for d in xpoints if n1 < d < n2])
    pos = [list(xpoints).index(d) for d in list(xpoints) if n1 < d < n2]
    yp = np.array([ypoints[i] for i in pos])
    plt.plot(xp, yp)
    plt.show()

    return np.array([xp, yp])


